import React from "react";
import "./home.css";
export default function home() {
  return (
    <div className="home ">
      <img
        src="./logo-2.jpeg"
        alt=""
        className="w-36 h-36 absolute left-10 top-10"
      />
      <div className="w-screen h-screen bg-transparent flex">
        <div className="w-4/12 bg-transparent flex items-center justify-center">
          <div className="   h-72 w-10/12 p-5 font-bold text-xl   rounded-md flex space-x-10 flex-wrap ">
            <Avatar
              src={
                "data:image/jpeg;base64,"
              }
            />
          </div>
        </div>
        <div className="w-8/12 bg-transparent"></div>
      </div>
    </div>
  );
}

